(17, 10485, 'OOD', 'Autumn Series Race - OOD closing message', 'Solo4400 we finished after 1 lap cos so far behind\r\nLaser 133260 did not register so we entered results manually\r\nthree boats were so far behind we \'W\' flagged them but they continued and finished as marked. ( Solo 5709, Laser 208190, Byte 1449)\r\n\r\n', '', NULL, 'received', '2022-11-06 17:48:21', '', '2022-11-06 17:48:21'),
(18, 10486, 'OOD', 'Autumn Series Race - OOD closing message', 'I had to amend Hurricane 390 as had missed clicking a lap but results correct now.\r\nAppreciate races too short! but tricky with safety boat breaking down & was advised everyone to be off the water by 10.30 in good time for Remembrance Sunday.', '', NULL, 'received', '2022-11-13 10:55:14', '', '2022-11-13 10:55:14'),
(19, 10490, 'Richard Watsham', 'NEW COMPETITOR - new competitor has been added', 'The OOD created a new competitor during the event - record id 10251.\n\nClass: Laser 4.7   Sail No.: 11   Helm: Clare Hughes\n\nThe OOD only enters some limited information and there may be additional fields that your club uses - e.g. allocating them to a group \n\nPlease check that additional competitor information your club uses has been added.\n', NULL, NULL, 'received', '2022-12-05 10:04:13', 'racebox', '2022-12-05 10:04:13'),
(20, 10490, 'OOD', 'Autumn Series Race - OOD closing message', 'user permissions for the database had been corrupted in mysql.  OOD took manual times and race regenerated on following day', '', NULL, 'received', '2022-12-05 11:04:18', '', '2022-12-05 11:04:18'),
(21, 10499, 'OOD', 'Winter Woolley Trophies Race - OOD closing message', 'unable to start the race because we had not captured all the entries we only realised the problem when the sequence would not  run. ended up starting the timer a little late when we realised what we had done wrong.', '', NULL, 'received', '2022-12-28 10:54:06', '', '2022-12-28 10:54:06');
